import React from 'react';

class Filter extends React.Component {
    constructor (props) {
        super (props);
    }

    componentDidMount () {
        console.log("Props ====>", this.props.filterType);
    }

    render () {
        return (
            <div>
                <ul>
                {this.props[1].map(filter => (
                    <li>
                        <input type="checkbox" />
                        <span className="desc-value"></span>
                    </li>
                ))}
                </ul>
            </div>
        )
    }
}

export default Filter;
